import styled, { keyframes } from "styled-components";

export const LoginWrapper = styled.div`
  width: 400px;
  height: 300px;
  border-radius: 4px;
  align-items: center;
  margin: auto;
  margin-top: 50px;
  background-color: #00000;
  display: flex;
  box-shadow: rgba(0, 0, 0, 0.1) 0px 0px 8px 0px;
`;
